  return (
   <Container maxW = "800px">
    <Flex justify= "space-between" height = "90vh" align = "cenetr">
      <Stack width = "300px">
        <Heading fontSIze = "3xl" color = "yellow.800" textALign = "center">
          List 1
        </Heading>
        <List p="4" minH = "70vh" boxShadow="xl" borderRadius = "md">
          <ListItem>players</ListItem>
        </List>
      </Stack>
      <Stack width = "300px">
      <Heading fontSIze = "3xl" color = "sky" textALign = "center">
          List 2
        </Heading>
        <List p="4" minH = "70vh" boxShadow="xl" borderRadius = "md">
          <ListItem></ListItem>
        </List>
      </Stack>
    </Flex>
   </Container>
  );
}

export default App;
